  margin-left:500px;
`;
const Text = styled.div`
  font-size:22px;
  margin-bottom:15px;
  margin-left:15px;
`;
const SliderPost = styled.div`
  max-width:300px;
  height:300px;
  background-color:grey;
`;
const SliderImage = styled.img`
  width:300px;
  height:150px;
`;
const SliderIconDiv = styled.div`
  width:80px;
  height:80px;
  background-color:white;
  margin-left:30px;
  margin-top:-30px;
  position: absolute;
`;
const SliderIcon = styled.img`
  width: 50px;
  height: auto;
  display: block;
  margin:auto;
  margin-top:15px;
`;
const SliderText = styled.div`
margin-left:120px;
margin-top:15px;
`;
const SliderInfo = styled.div`
margin-top:30px;
`;
const SliderMiniIcon = styled.img`
float:left;
margin:15px;
`;
const SliderMiniText = styled.div`
float:left;
margin:15px;
`;
const Timeline = styled.div`
float:left;
`;
